package dataStructure;import java.time.Year;public class Hash<K, V> implements HashI {    class HashElement<K, V> implements Comparable<HashElement<K, V>> {        K key;        V value;        public HashElement(K key, V value) {            this.key = key;            this.value = value;        }        public int compareTo(HashElement<K, V> o) {            return ((Comparable<K>) this.key).compareTo(o.key);        }    }    int numElements;    int tableSize;    double maxLoadfactor;    LinkedList<HashElement<K, V>>[] harray;}